void stencil2d::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"surface_address0\" :  \"" << surface_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"surface_ce0\" :  \"" << surface_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"surface_q0\" :  \"" << surface_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"surface_address1\" :  \"" << surface_address1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"surface_ce1\" :  \"" << surface_ce1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"surface_q1\" :  \"" << surface_q1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_surface_address0\" :  \"" << output_surface_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_surface_ce0\" :  \"" << output_surface_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_surface_we0\" :  \"" << output_surface_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_surface_d0\" :  \"" << output_surface_d0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"output_surface_q0\" :  \"" << output_surface_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_surface_address1\" :  \"" << output_surface_address1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_surface_ce1\" :  \"" << output_surface_ce1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"output_surface_q1\" :  \"" << output_surface_q1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"target_time_s\" :  \"" << target_time_s.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"dt\" :  \"" << dt.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"dx\" :  \"" << dx.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"diffusivity\" :  \"" << diffusivity.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

